{
   static int Str_init = 0;
   if (Str_init) return;
   Str_init = 1;
   if (sizeof(Str_CHARSET)!=32) X2C_ASSERT(0);
   if (sizeof(ATC)!=23) X2C_ASSERT(0);
   ConvTypes_BEGIN();
   WholeStr_BEGIN();
   LongConv_BEGIN();
   LongStr_BEGIN();
   Strings_BEGIN();
}

